import React from "react";
import { getHomes } from "../service/home.service";

class HomeList extends React.Component {
  constructor(props) {
    super(props);
    this.state = { homes: [] };
  }

  componentDidMount() {
    // const homes = getHomes();
    // console.log(homes);
    getHomes().then((data) => {
      console.log(data);
      this.setState({ homes: data });
    });
    // this.setState({ homes: homes });
  }

  render() {
    return (
      <div>
        {this.state.homes && this.state.homes.map((home) => <div>{home}</div>)}
      </div>
    );
  }
}

export default HomeList;
